import React from 'react';
import './Awards.css';
import TopBar from './components/TopBar';
import { CardHorizontal } from './Blog';

function Awards(){
    return(
    <>
        <TopBar/>
        <div className='content'>
            <CardHorizontal title="2022-23 Power Play" content="NorCal FTC - South Bay Metro League 

 ⇒ Ranked #2 & WAC 1st pick at League tournament

 ⇒ California Ranked - 3rd

 ⇒ California 4th Highest Score

 ⇒ Innovate Award Winner

NorCal FTC - Regional Championship

 ⇒ Sillicone Division Winning Alliance Captain

 ⇒ Finalist Alliance Captain

 ⇒ Think Award 3rd Place

 ⇒ World Ranked -top 30's (OPR 145 pts)

Maryland Tech Invitational, APL John Hopkins University​

 ⇒ Ranked #15 (2023) among 40 teams worldwide"></CardHorizontal>
        </div>
    </>
    );
}
export default Awards;
